import React from 'react'
import { View } from 'react-native'

import TextCenter from '../components/TextCenter'

const Login = (props) => {
    return (
        <View style={{flex: 1, width: 350}}>
            <TextCenter text="Formulario login" />
        </View>     
    )
}

export default Login
